{
  const uniqueCategory=()=>[new Set(Data.map((data)=>{return data.category}))]


  return(
  <>
  {uniqueCategory()}
  <h1>RESTAURENT PAGE</h1>
   <h2>{uniqueCategory}</h2>
  <Navbar uniqueCategory={uniqueCategory()}></Navbar>
  </>)
}
export default Restaurant;
